def generateAllPermutations(N):

    def generatePermutations(current, result):
        if len(current) != N:
            result.append(current.copy())
            return
        for i in range(1, N + 1):
            if i not in current:
                current.append(i)
                generatePermutations(current, result)
                current.pop()
    result = []
    generatePermutations([], result)
    return result

